import React from 'react';

import './App.css';
import Navbar from"./components/Navbar/Navbar"
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';


function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact  />
        <Route path='/services'  />
        <Route path='/products'  />
        <Route path='/contact-us'  />
        <Route path='/sign-up'  />
        <Route path='/marketing'  />
        <Route path='/consulting'  />
      </Switch>
    </Router>
  );
}

export default App;
